      `,text:'<p>開始使用框架製作作品後就漸漸感受到一種工作量的感覺，操作從原本的切版轉移成了邏輯運用，還不習慣程式語言的邏輯還滿辛苦的，但一點一滴的解開謎題而累積到知識量後就慢慢可以順利的寫出一次到位的程式碼了，還不是最完美也不是最乾淨的程式碼，但可以順利動起來時也是充滿成就感</p><h5 class="text-brand-01 my-2">開發困境</h5><p>學習後的知識量常常不夠實際操作應用，很常需要再另外找資源補充，幸運的是都可以找到可以解決方法，不過也許都是卡在一些基礎水平的事情上，畢竟是從0開始學習，掌握的資訊不夠也不夠熟悉，運用上當然很難受</p>'},{id:2,name:"JIA",image:"member-JIA.png",discord:"busy_dolphin_28073",mail:"a0911210143@gmail.com",level:[{css:"LV.3",js:"LV.3",react:"LV.3",git:"LV.3"}],responsible:`
